import React from "react";
import VideoPayer from "react-video-js-player";
import Car from "./images/v1.mp4";

const VideoPLayer = () =>{
    const videoSrc = Car;
     return(
         <div className="App">
             <h1>Hii</h1>
             <VideoPLayer src ={videoSrc} />

         </div>
     );}
     export default VideoPLayer
